Starten einer Prozessinstanz
Siehe Konzept zum Starten von Prozessinstanzen.
import {
  ConsumerContext,
  IConsumerApiService,
  ProcessStartResponsePayload,
  ProcessStartResponsePayload,
  StartCallbackType,
} from '@process-engine/consumer_api_contracts';

// Retrieve through dependency injection
const consumerApiService: IConsumerApiService;

// The JWT token must be provided by the implementing application
const context: ConsumerContext = {
  identity: 'insertJwtTokenHere',
};

// Required paramters
const processModelKey = 'test_consumer_api_process_start';
const startEventKey = 'StartEvent_1';

// Optional parameters
const payload: ProcessStartRequestPayload = {
  correlationId: 'randomcorrelationid',
  inputValues: {},
};
const startCallbackType: StartCallbackType =
  StartCallbackType.CallbackOnEndEventReached;

const endEventKey = 'EndEvent_1';

// Start the process instance
const result: ProcessStartResponsePayload =
  await consumerApiService.startProcessInstance(consumerContext,
                                                processModelKey,
                                                startEventKey,
                                                payload,
                                                startCallbackType,
                                                endEventKey);

Parameter
Erforderliche Parameter

context - Der ConsumerContext des aufrufenden Benutzers
processModelKey - Der Key der das Prozessmodell identifiziert, welches
gestartet werden soll
startEventKey - Der Key des StartEvents, Das zum starten des Prozesses
ausgelöst werden soll
endEventKey - Der Key des EndEvents, bei dessen erreichen die
Schnittstelle antwortet. Wird nur ausgewertet, wenn startCallbackType
auf CallbackOnEndEventReached gesetzt wurde, ist dann aber Pflichtangabe

Optionale Parameter

payload - Enthält Parameter für den Prozessstart
startCallbackType - Gibt an, wann die Schnittstelle antwortet
CallbackOnProcessInstanceCreated - Die Schnittstelle antwortet, wenn die
Prozessinstanz gestartet  wurde
CallbackOnProcessInstanceFinished - Die Schnittstelle antwortet, wenn die
Prozessinstanz beendet  wurde
CallbackOnEndEventReached - Die Schnittstelle antwortet, wenn die
Prozessinstanz durch ein bestimmtes EndEvent beendet wurde
Default ist CallbackOnProcessInstanceCreated
Siehe: StartCallbackType



Rückgabewerte
Die Rückgabe der Methode entspricht dem Typen ProcessStartResponsePayload
und enthält die correlationId des gestarteten Vorgangs:
{
  "correlationId": "d44c820a-9a78-44b4-af64-5968625cffad"
}

Fehler, die erwartet werden müssen
Mögliche auftretende Fehler sind:

400:
Die bereitgestellten inputValues sind ungültig
Der bereitgestellte Wert für startCallbackType ist ungültig


401: Der anfragende Benutzer hat keine gültige Authentifizierung
403: Der anfragende Benutzer hat auf den angegebenen Prozess keinen Zugriff
404:
Es konnte kein Prozessmodell mit dem gegebenen processModelKey
gefunden werden
Das Prozessmodell hat kein Startevent mit dem angegebenen startEventKey
Das Prozessmodell hat kein EndEvent mit dem gegebenen endEventKey


500:
Der Prozess konnte wegen eines internen Fehlers nicht gestartet werden
Der Prozess brach vor erreichen des angegebenen startCallbackType Events wegen
eines Fehlers vorzeitig ab
Beim Verarbeiten der Anfrage trat ein systeminterner Fehler auf

Auflisten wartender UserTasks
Siehe Konzept zum Auflisten wartender UserTasks.
import {
  ConsumerContext,
  IConsumerApiService,
  UserTaskList
} from '@process-engine/consumer_api_contracts';

// Retrieve through dependency injection
const consumerApiService: IConsumerApiService;

// The JWT token must be provided by the implementing application
const context: ConsumerContext = {
  identity: 'insertJwtTokenHere',
};

// Required parameters
const processModelKey: string = 'consumer_api_lane_test';
const correlationId: string = 'someCorrelationId';

// Get the user tasks for the correlation
let userTaskList: UserTaskList =
  await consumerApiService.getUserTasksForCorrelation(context, correlationId);

// Get the user tasks for the process model
userTaskList =
  await consumerApiService.getUserTasksForProcessModel(context, processModelKey);

// Get the user tasks for the process model within the correlation
userTaskList =
  await consumerApiService.getUserTasksForProcessModelInCorrelation(context,
                                                                    processModelKey,
                                                                    correlationId);

Parameter
Erforderliche Parameter

context - Der ConsumerContext des aufrufenden Benutzers

Optionale Parameter

processModelKey - Wenn angegeben, werden nur UserTasks angefragt, die zu
dem ProzessModell gehören, das durch diesen Key identifiziert wird.
correlationId - Wenn angegeben, werden nur UserTasks angefragt, die zu
dem Vorgang gehören, der mit dieser ID identifiziert wird.

Werden beide Parameter in Kombination verwendet, werden nur die UserTasks
aufgelistet, die zu der passenden Prozessinstanz in der passenden Correlation
gehören.
Rückgabewerte
Die Rückgabe ist vom Typ UserTasksList und beinhaltet
eine Liste aller gefundenen UserTasks, die darauf warten bearbeitet zu werden.
Diese wiederum werden durch den Typ UserTask dargestellt.
Beispielausgabe:
{
  "userTasks": [
    {
      "id": "004d6b6d-8467-4893-8b23-fe5f380389aa",
      "key": "SomeUserTask1",
      "processInstanceId": "19ff240a-239e-4ee6-ac29-665fb3b57078",
      "data": {
        "formFields": [
          {
            "id": "someFormFieldId",
            "type": "string",
            "label": "someFormFieldLabel",
            "defaultValue": "someTestDefaultValue"
          }
        ]
      }
    }
  ]
}

